import {configFieldFactory} from './configFieldFactory';
import {validation} from '@caldera-labs/components';

/**
 * Prepare a collection of config fields
 *
 * Optionally merges with default config fields
 * Optionally sets values from a Map of config values
 *
 * @param {Object} configFields Config fields for processor. Indexed by config ID.
 * @param {Object} configFieldsDefaults Optional. Config field defaults for processor. Indexed by config ID.
 * @returns {Object}
 */
export const configFieldsFactory = (configFields, configFieldsDefaults = {}  ) => {
	Object.keys( configFields ).forEach( configFieldId => {
		if( configFieldsDefaults.hasOwnProperty(configFieldId)){
			configFields[configFieldId] = configFieldFactory(
				configFields[configFieldId],
				configFieldsDefaults[configFieldId]
			);

		}
	});

	Object.keys( configFieldsDefaults ).forEach( configDefaultId => {
		if( ! configFields.hasOwnProperty(configDefaultId)){
			configFields[configDefaultId] = configFieldsDefaults[configDefaultId];
		}
	});

	Object.keys( configFields ).forEach(configFieldId  => {
		configFields[configFieldId].id = configFieldId;
		configFields[configFieldId].ID = configFieldId;
		configFields[configFieldId] = validation.addAutomaticValidators(configFields[configFieldId]);
	});

	return configFields;
};

import {configFieldsFactory} from './configFieldsFactory';
import {processorTypes} from '../processors/processorTypes';

/**
 * Global map of all processor types
 *
 * @todo remove this
 *
 * @type {Map<any, any>}
 */
export const processorTypesMap = new Map();

Object.values(processorTypes).forEach( type =>{
	processorTypesMap.set(type.TYPE, type);
});


/**
 * Get the configuration for a processor
 *
 * This will merge in defaults, and set values from supplied configValues.
 * Does not provide callback functions for updating those values.
 * Those callback functions MUST get added before they are used in the default manner.
 *
 * @param {String} ID
 * @param {String} type
 * @param {Map} processorTypes
 * @param {Object} configFields Config fields for processor. Indexed by config ID.
 */
export const processorFactory = ( ID, type, configFields = {}, processorTypes = processorTypesMap ) =>  {
	let processor = {
		ID,
		type,
		configFields
	};
	if( processorTypes.has( type ) ){
		const configFieldDefaults =
			processorTypes.get( type ).hasOwnProperty( 'defaultConfigFields' )
				? processorTypes.get( type ).defaultConfigFields
				: {};

		processor.configFields = configFieldsFactory(configFields,configFieldDefaults);

	}
	return processor;

